import React from "react";
import './App.css';
import NCAAF from './pages/ncaaF'
import Home from './pages/Home'
import Matchups from './pages/Matchups'
import Sidebar from "./components/Sidebar/Sidebar";



function App() {

  let component
  switch(window.location.pathname) {
      case "/":
        component = <Home />
        break;
      case "/Matchups":
        component = <Matchups />
        break;
      case "/NCAAF":
        component = <NCAAF />
        break;
  }

  return (
    <div className="App">
      <div className="AppGlass">

        <Sidebar />
        {component}

        <div className="1">
          <h1>
            Test1
          </h1> 
        </div>

        <div className="2">
          <h1>
            Test2
          </h1>
        </div>

        <div className="3">
          <h1>
            Test3
          </h1>
        </div>

      </div>
    </div>
  );
}

export default App;
